import React from 'react';

class Settings extends React.Component {
  render() {
    return (
      <div style={{ margin: 'auto', textAlign: 'center' }}>
        <h1 style={{ color: 'yellow' }} data-testid="settings-title">Configurações</h1>
      </div>
    );
  }
}


export default Settings;
